// src/components/Home.js
import React from 'react';

const technicalSkills = [
  { name: 'HTML5', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/html5/html5-original.svg' },
  { name: 'CSS3', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/css3/css3-original.svg' },
  { name: 'JavaScript', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/javascript/javascript-original.svg' },
  { name: 'Python', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original.svg' },
  { name: 'Java', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/java/java-original.svg' },
  { name: 'jQuery', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/jquery/jquery-original.svg' },
  { name: 'ASP.NET', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/dot-net/dot-net-original.svg' },
  { name: 'SQL', img: 'https://cdn-icons-png.flaticon.com/512/2772/2772128.png' },
  { name: 'MySQL', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mysql/mysql-original.svg' },
  { name: 'Oracle', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/oracle/oracle-original.svg' },
  { name: 'WordPress', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/wordpress/wordpress-original.svg' },
  { name: 'Shopify', img: 'https://cdn-icons-png.flaticon.com/512/5968/5968906.png' },
  { name: 'AWS', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/amazonwebservices/amazonwebservices-original-wordmark.svg' },
  { name: 'Azure', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/azure/azure-original.svg' },
  { name: 'GCP', img: '/logo/googlecloud.png' },
  { name: 'Office 365', img: '/logo/office365.jpg' },
  { name: 'Google Charts', img: '/logo/googlecharts.png' },
  { name: 'Draw.io', img: '/logo/drawio.png' }
];

const Home = () => {
  const sectionStyle = {
    backgroundColor: '#111',
    color: '#eee',
    padding: '2rem',
    marginBottom: '2rem',
    borderRadius: '8px',
  };

  return (
    <div>
      {/* Hero Section */}
      <section
        id="hero"
        style={{
          background: 'linear-gradient(135deg, #0f2027, #203a43, #2c5364)',
          color: '#fff',
          padding: '6rem 2rem',
          textAlign: 'center',
          borderRadius: 8,
          marginBottom: '2rem',
          overflow: 'hidden',
          position: 'relative',
        }}
      >
        <h1
          style={{
            fontSize: '3.5rem',
            fontWeight: '900',
            marginBottom: '1rem',
            opacity: 0,
            transform: 'translateY(30px)',
            animation: 'fadeSlideIn 1s forwards',
            animationTimingFunction: 'cubic-bezier(0.68, -0.55, 0.27, 1.55)',
          }}
        >
          Welcome
        </h1>

        <p
          style={{
            fontSize: '1.5rem',
            marginBottom: '2rem',
            fontWeight: '500',
            minHeight: '2rem',
            color: '#ddd',
            fontFamily: 'Courier, monospace',
            whiteSpace: 'nowrap',
            overflow: 'hidden',
            borderRight: '3px solid #fff',
            width: 'fit-content',
            marginLeft: 'auto',
            marginRight: 'auto',
            animation: 'typing 3s steps(20) 1 forwards, blink 0.75s step-end infinite',
            opacity: 0,
            animationDelay: '1.2s',
            animationFillMode: 'forwards',
          }}
        >
          Welcome to My Portfolio!
        </p>

        <button
          style={{
            padding: '1rem 2.5rem',
            fontSize: '1.1rem',
            fontWeight: '600',
            color: '#203a43',
            backgroundColor: '#fff',
            border: 'none',
            borderRadius: '30px',
            cursor: 'pointer',
            boxShadow: '0 5px 15px rgba(255,255,255,0.3)',
            transition: 'background-color 0.3s ease, transform 0.3s ease',
            opacity: 0,
            transform: 'translateY(30px)',
            animation: 'fadeSlideIn 1s forwards',
            animationDelay: '2.6s',
            animationTimingFunction: 'cubic-bezier(0.68, -0.55, 0.27, 1.55)',
          }}
          onMouseEnter={(e) => {
            e.currentTarget.style.backgroundColor = '#e6e6e6';
            e.currentTarget.style.transform = 'scale(1.05)';
          }}
          onMouseLeave={(e) => {
            e.currentTarget.style.backgroundColor = '#fff';
            e.currentTarget.style.transform = 'scale(1)';
          }}
          onClick={() => window.scrollTo({ top: window.innerHeight, behavior: 'smooth' })}
        >
          Explore
        </button>

        <style>{`
          @keyframes fadeSlideIn {
            to {
              opacity: 1;
              transform: translateY(0);
            }
          }
          @keyframes typing {
            from { width: 0 }
            to { width: 18ch }
          }
          @keyframes blink {
            50% { border-color: transparent }
          }
          @media (max-width: 768px) {
            #hero h1 {
              font-size: 2.8rem !important;
            }
            #hero p {
              font-size: 1.2rem !important;
            }
            #hero button {
              font-size: 1rem !important;
              padding: 0.8rem 2rem !important;
            }
          }
          @media (max-width: 480px) {
            #hero h1 {
              font-size: 2.4rem !important;
            }
            #hero p {
              font-size: 1rem !important;
            }
            #hero button {
              font-size: 0.9rem !important;
              padding: 0.7rem 1.8rem !important;
            }
          }
        `}</style>
      </section>

      {/* Career Objective */}
      <section id="career-objective" style={sectionStyle}>
        <h2>Career Objective</h2>
        <p>
          Graduate in Bachelor of Information Technology from Melbourne Polytechnic with
          industry-based project experience. Experienced in Python, WordPress, HTML5, CSS,
          and JavaScript. Previously an IT Software Developer intern at 10th Dan, Melbourne.
          Currently a Multi-Site Store Manager with 5 years customer service experience.
          Seeking to develop an IT career and skillset.
        </p>
      </section>

      {/* Technical Skills */}
      <section id="technical-skills" style={sectionStyle}>
        <h2>Technical Skills</h2>
        <div
          style={{
            display: 'flex',
            flexWrap: 'wrap',
            gap: '1.5rem',
            justifyContent: 'center',
            alignItems: 'center',
            marginBottom: '1rem',
          }}
        >
          {technicalSkills.map(skill => (
            <div
              key={skill.name}
              style={{
                textAlign: 'center',
                width: 100,
                color: '#eee',
                cursor: 'default',
                transition: 'transform 0.3s ease',
                animation: 'fadeSlideIn 0.6s forwards',
                animationDelay: `calc(0.1s * ${technicalSkills.indexOf(skill)})`,
                opacity: 0,
              }}
              title={skill.name}
              onMouseEnter={e => e.currentTarget.style.transform = 'scale(1.2)'}
              onMouseLeave={e => e.currentTarget.style.transform = 'scale(1)'}
            >
              <img
                src={skill.img}
                alt={skill.name}
                style={{ width: 70, height: 70, objectFit: 'contain', marginBottom: '0.5rem' }}
              />
              <div style={{ fontSize: '1rem', fontWeight: '600' }}>{skill.name}</div>
            </div>
          ))}
        </div>
      </section>

      {/* Education */}
      <section id="education" style={sectionStyle}>
        <h2>Education</h2>
        <p><strong>Bachelor of Information Technology (Software Development)</strong></p>
        <img
          src="/logo/mp.jpg"
          alt="Melbourne Polytechnic"
          style={{ height: 40, marginLeft: 10, verticalAlign: 'middle' }}
        />
        <p>Melbourne Polytechnic, July 2019 – July 2022</p>
      </section>

      {/* Professional Development */}
      <section id="professional-development" style={sectionStyle}>
        <h2>Professional Development</h2>
        <div
          style={{
            display: 'flex',
            flexWrap: 'wrap',
            gap: '2rem',
            justifyContent: 'center',
          }}
        >
          {/* Each certificate block */}
          {[
            { name: 'Professional Year (Oct 2022 – Apr 2023), Performance Education', img: '/logo/pe.png', alt: 'Performance Education' },
            { name: 'AWS Cloud Practitioner Essentials, AWS Training', img: '/logo/aws.png', alt: 'AWS' },
            { name: 'Google Professional Cloud Developer Certificate', img: '/logo/gcpd.png', alt: 'Google Cloud' },
            { name: 'Business Analysis and Process Management, Coursera', img: '/logo/c.png', alt: 'Coursera' },
            { name: 'Marketing Tools: Social Media, LinkedIn Learning', img: '/logo/linkedin.png', alt: 'LinkedIn Learning' },
            { name: 'Software Development Analytics Certification, SAS', img: '/logo/sas.png', alt: 'SAS' },
            { name: 'Web Page Development Certification, Alison', img: '/logo/alison.jpg', alt: 'Alison' },
            { name: 'Database Foundations, LinkedIn Learning', img: '/logo/linkedin.png', alt: 'LinkedIn Learning' },
            { name: 'Salesforce Developer AI Introduction, Alison', img: '/logo/alison.jpg', alt: 'Alison' },
            { name: 'Diploma in HTML5, CSS3, JavaScript and Python, Alison', img: '/logo/alison.jpg', alt: 'Alison' },
          ].map((cert, i) => (
            <div
              key={cert.name}
              style={{
                display: 'flex',
                alignItems: 'center',
                backgroundColor: '#222',
                borderRadius: '8px',
                padding: '1rem 1.5rem',
                width: '320px',
                boxShadow: '0 0 15px rgba(255,255,255,0.1)',
                transition: 'transform 0.3s ease',
                cursor: 'default',
                opacity: 0,
                animation: 'fadeSlideIn 0.7s forwards',
                animationDelay: `${0.1 * i}s`,
              }}
              onMouseEnter={e => e.currentTarget.style.transform = 'scale(1.05)'}
              onMouseLeave={e => e.currentTarget.style.transform = 'scale(1)'}
              title={cert.name}
            >
              <img
                src={cert.img}
                alt={cert.alt}
                style={{ height: 50, marginRight: '1rem', objectFit: 'contain', borderRadius: 4 }}
              />
              <span style={{ fontSize: '1rem', color: '#eee', fontWeight: '600' }}>{cert.name}</span>
            </div>
          ))}
        </div>
      </section>

      {/* Work Experience */}
      <section id="work-experience" style={sectionStyle}>
        <h2>Work Experience</h2>

        <h5>AI Based Social Media Plugin Developer (Internship) - 10th Dan</h5>
        <p>May 2023 – Aug 2023, Melbourne</p>
        <ul>
          <li>Developed Instagram API plugin using Python and VS Code.</li>
          <li>Integrated API, developed algorithms, testing, debugging.</li>
          <li>Managed project schedules and documented workflows.</li>
        </ul>

        <h5>Project Intern & Admin Assistant - Enablement Nepal</h5>
        <p>Jun 2018 – Nov 2018, Kathmandu</p>
        <ul>
          <li>Webpage design, data entry, project management assistance.</li>
          <li>Handled IT section support and scheduled workshops.</li>
        </ul>

        <h5>Multi-Site Store Manager - Fossil Watches Australia</h5>
        <p>Oct 2022 – Present, Melbourne</p>
        <ul>
          <li>Store opening/closing, sales reporting, employee management.</li>
          <li>Customer service, cash handling, visual merchandising.</li>
        </ul>
      </section>

      {/* References */}
      <section id="references" style={sectionStyle}>
        <h2>References</h2>
        <p><strong>Brandy Sahagun</strong> - Area Manager, Fossil Australia</p>
        <p>Email: bsahagun@fossil.com | Phone: 0434 582 952</p>

        <p><strong>Paul Kefford</strong> - Managing Director, 10th Dan</p>
        <p>Email: paul.kefford@10thdan.com | Phone: 0432 767 635</p>

        <p><strong>Sarah Smith</strong> - Course Coordinator, Melbourne Polytechnic</p>
        <p>Email: sarah.smith@melbournepolytechnic.edu.au | Phone: +61 3 9269 8888</p>
      </section>

      {/* Global Animations */}
      <style>{`
        @keyframes fadeSlideIn {
          to {
            opacity: 1;
            transform: translateY(0);
          }
        }
      `}</style>
    </div>
  );
};

export default Home;
